ice in the various sectors of the Nigerian real estate industry.<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">We recently received an award as the overall best marketer consultant of the year 2021 with two Toyota Highlander Jeep gift from GreenPasture Homes Estate, Apo \\u2013 Abuja, Nigeria.<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">We are rapidly expanding with expertise and specialization in (real estate) housing development and management. We have been able to stand out in the industry in a short period of existence.<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">At keysquare Homes &amp; Properties Ltd we provide our clients with First class services such as development, management, sales partnership, letting and facility management, Keysaquare Homes &amp; Properties Ltd is a real estate consulting firm positioned to be the leading brand in Nigeria and Africa. Our services includes, apartments, Suites, Office space and commercial outlets.<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\">&nbsp;<\\/p><figure class=\\\"image image_resized\\\" style=\\\"width:50%;\\\"><img src=\\\"http:\\/\\/key-square.test\\/storage\\/1652098460948.jpg\\\" alt=\\\"1652098460948.jpg\\\"><\\/figure><figure class=\\\"image image_resized\\\"><img src=\\\"http:\\/\\/key-square.test\\/storage\\/teaching.jpg\\\" alt=\\\"teaching.jpg\\\"><\\/figure><p>&nbsp;<\\/p><p>&nbsp;<\\/p><figure class=\\\"image image_resized\\\" style=\\\"width:25%;\\\"><img src=\\\"http:\\/\\/key-square.test\\/storage\\/mission.png\\\" alt=\\\"mission.png\\\"><\\/figure><h4 style=\\\"background-color:rgb(255,255,255);color:rgba(0,0,0,0.8);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:1.5rem;font-style:normal;font-weight:400;line-height:1.5;margin-bottom:0.5rem;margin-left:80px;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"font-family:\'Times New Roman\', Times, serif;\\\">OUR MISSION<\\/span><\\/h4><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-left:80px;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">At Key square Homes &amp; Properties Ltd, our mission is to serve each client with integrity, excellence and efficiency. Also, to create value, positively developing, managing and investing in quality satisfaction. Our mission statement is service to humanity.<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\">&nbsp;<\\/p><figure class=\\\"image image_resized\\\" style=\\\"width:25%;\\\"><img src=\\\"http:\\/\\/key-square.test\\/storage\\/vision.png\\\" alt=\\\"vision.png\\\"><\\/figure><h4 style=\\\"background-color:rgb(255,255,255);color:rgba(0,0,0,0.8);font-fami