(70, 1, 'page', '{\"name\":\"About us\",\"slug\":\"about-us\",\"slug_id\":\"9\",\"is_slug_editable\":\"1\",\"model\":\"Botble\\\\Page\\\\Models\\\\Page\",\"description\":\"Key Square Homes & Properties LTD\",\"is_featured\":\"0\",\"content\":\"<h2 class=\\\"mb-4\\\" style=\\\"background-color:rgb(255,255,255);color:rgba(0,0,0,0.8);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:50px;font-style:normal;line-height:1.4;margin-bottom:1.5rem;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"font-family:\'Times New Roman\', Times, serif;\\\"><strong>Key Square Homes &amp; Properties LTD<\\/strong><\\/span><\\/h2><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">The company: A wholly indigenous private limited liability company with RC 1721549 excellent customized services in the real estate sector of the economy.<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">Driven by a strong desire for an enduring legacy of customer oriented efficient service and also complemented by a plethora of result oriented professional<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">Over the years of our services, we are proud to have maintained our speedy and transparent approach to our service in the various sectors of the Nigerian real estate industry.<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">We recently received an award as the overall best marketer consultant of the year 2021 with two Toyota Highlander Jeep gift from GreenPasture Homes Estate, Apo \\u2013 Abuja, Nigeria.<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">We are rapidly expanding with expertise and specialization in (real estate) housing development and management. We have been able to stand out in the industry in a short period of existence.<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">At keysquare Homes &amp; Properties Ltd we provide our clients with First class services such as development, management, sales partnership, letting and facility management, Keysaquare Homes &amp; Properties Ltd is a real estate consulting firm positioned to be the leading brand in Nigeria and Africa. Our services includes, apartments, Suites, Office space and commercial outlets.<\\/span><\\/p><figure class=\\\"image image_resized\\\" style=\\\"width:75%;\\\"><img src=\\\"https:\\/\\/keysquareproperties.com.ng\\/storage\\/1652098460948.jpg\\\" alt=\\\"1652098460948\\\"><\\/figure><p>&nbsp;<\\/p><p>&nbsp;<\\/p><p><img src=\\\"https:\\/\\/keysquareproperties.com.ng\\/storage\\/teaching.jpg\\\" alt=\\\"teaching\\\"><br><br>&nbsp;<\\/p><p>&nbsp;<\\/p><p style=\\\"margin-left:80px;\\\"><img class=\\\"image_resized\\\" style=\\\"width:50%;\\\" src=\\\"https:\\/\\/keysquareproperties.com.ng\\/storage\\/mission.png\\\" alt=\\\"mission\\\"><br>&nbsp;<\\/p><h4 style=\\\"background-color:rgb(255,255,255);color:rgba(0,0,0,0.8);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:1.5rem;font-style:normal;font-weight:400;line-height:1.5;margin-bottom:0.5rem;margin-left:80px;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"font-family:\'Times New Roman\', Times, serif;\\\">OUR MISSION<\\/span><\\/h4><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-left:80px;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">At Key square Homes &amp; Properties Ltd, our mission is to serve each client with integrity, excellence and efficiency. Also, to create value, positively developing, managing and investing in quality satisfaction. Our mission statement is service to humanity.<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgb(153,153,153);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:16px;font-style:normal;font-weight:400;margin-bottom:1rem;margin-top:0px;word-spacing:0px;\\\">&nbsp;<\\/p><p style=\\\"margin-left:80px;\\\">&nbsp; <img class=\\\"image_resized\\\" style=\\\"width:50%;\\\" src=\\\"https:\\/\\/keysquareproperties.com.ng\\/storage\\/vision.png\\\" alt=\\\"vision\\\"><br>&nbsp;<\\/p><h4 style=\\\"background-color:rgb(255,255,255);color:rgba(0,0,0,0.8);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:1.5rem;font-style:normal;font-weight:400;line-height:1.5;margin-bottom:0.5rem;margin-left:80px;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;\\\">OUR VISION<\\/span><\\/h4><p style=\\\"background-color:rgb(255,255,255);color:rgba(0,0,0,0.8);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:1.5rem;font-style:normal;font-weight:400;line-height:1.5;margin-bottom:0.5rem;margin-left:80px;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"background-color:rgb(255,255,255);color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;font-size:16px;\\\"><span style=\\\"font-family:\'Nunito Sans\', Arial, sans-serif;font-style:normal;font-weight:400;word-spacing:0px;\\\">To be the leading consulting firm in the real estate sector through integrity, innovations, excellence and to provide value for money invested by our client both in Nigeria and abroad.<\\/span> &nbsp;<\\/span><\\/p><p style=\\\"background-color:rgb(255,255,255);color:rgba(0,0,0,0.8);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:1.5rem;font-style:normal;font-weight:400;line-height:1.5;margin-bottom:0.5rem;margin-left:80px;margin-top:0px;word-spacing:0px;\\\">&nbsp;<\\/p><h4 style=\\\"background-color:rgb(255,255,255);color:rgba(0,0,0,0.8);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:1.5rem;font-style:normal;font-weight:400;line-height:1.5;margin-bottom:0.5rem;margin-left:80px;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"font-family:\'Times New Roman\', Times, serif;\\\">OUR BRAND<\\/span><\\/h4><p style=\\\"background-color:rgb(255,255,255);color:rgba(0,0,0,0.8);font-family:\'Nunito Sans\', Arial, sans-serif;font-size:1.5rem;font-style:normal;font-weight:400;line-height:1.5;margin-bottom:0.5rem;margin-left:80px;margin-top:0px;word-spacing:0px;\\\"><span style=\\\"background-color:rgb(255,255,255);color:hsl(0,0%,0%);font-family:\'Times New Roman\', Times, serif;font-size:16px;\\\"><span style=\\\"font-family:\'Nunito Sans\', Arial, sans-serif;font-style:normal;font-weight:400;word-spacing:0px;\\\">All ou