(3, 'Harryelopy', 'enauda.studio@gmail.com', '86858252872', NULL, NULL, 'http://nextel.paymoney.cloud is a modern e-Banking solution without boundaries. \r\n \r\nWe provide a way to receive and transfer money via SEPA (EU), CHAPS (UK), ACH (US), Singapore, New Zealand, Australia, Turkey, Hungary domestic bank accounts, SWIFT worldwide bank transfers. \r\n \r\nOur platform allows to register and deposit money via cryptocurrency, deposit payments via domestic US, UK, EU, Singapore, New Zealand, Australia, Turkey, Hungary bank wires, withdraw balance to credit card, cryptocurrency, or send money to any bank account worldwide. \r\n \r\nYou can use our solution to receive various local payments and forward it to cryptocurrency wallets, or deposit money via your local bank and pay it out in cryptocurrency for your partners. Also you are able to deposit the balance in cryptocurrency and pay it out to bank wire. \r\n \r\nWe work with all international partners. We do not disclose information about our customers to third parties. \r\n \r\nFeel free to reach us via email hello@nextel.capital if you have any questions or partnership offers.', 'unread', '2022-11-10 05:30:49', '2022-11-10 05:30:49');

